webpackJsonp([0xf927f8900006],{507:function(e,t){e.exports={data:{site:{siteMetadata:{title:"Dustin Schau - Blog",author:"Dustin Schau"}},markdownRemark:{id:"C:/Users/ruioliveiras/Desktop/ruioliveiras.com/content/blog/2017-07-10-about-me/index.md absPath of file >>> MarkdownRemark",html:"<p><strong>Hi my name is Rui Oliveiras,</strong>\nand I started in the world of programming back to 2010 in a professional high school in my little town. On that course I remember of using technologies like Pascal and Visual Basic (.net), and of course the old C.\nDuring this programming professional course I participated in some algorithm contests, was very challenging.</p>\n<p><strong>The entrance on the university was a little hard</strong>, the math of my course was very rudimentary. But frequenting the lessons of regular high school I could learn the necessary math to have a good grate and enter in the university.</p>\n<p><strong>In the university of Minho</strong> I studied for 3 years Informatic Engineering, because already had background in programming, could deepen my knowledge. I learned a lot.</p>\n<p><strong>My first Job</strong> was very challenging, I worked at Adclick, in a project made only by me. I went to WebSummit 2016 bacause of that project.</p>\n<p><strong>Right now I’m working in a team, the FOX team!</strong> programming an enterprise software: the Order Management System of the Jumia.</p>",excerpt:"Hi my name is Rui Oliveiras, \nand I started in the world of programming back to 2010 in a professional high school in my little town. On that course I remember…",timeToRead:1,frontmatter:{date:"July 10, 2017",rawDate:"2017-07-10T23:36:56.503Z",excerpt:'This is my personal blog, with posts about <b>Scala</b>, Java, JVM and <b>Software Architecture</b>. </p> Check my <b><a href="/cv.pdf">Curriculum Vitae</a></b></p>',path:"/about",tags:["about","pinned"],title:"About",image:{childImageSharp:{resize:{src:"/static/ui-and-code-2e2425a623d633d1b1f4d4b156a32d6b-2c40b.png"}}}}}},pathContext:{prev:{excerpt:"Web Summit 2016 This year (2016) web summit was in Portugal (Lisbon). Was my first time in a conference like that. I stay in a little Hotel called Hotel of Chile with 2 stars - in the  room 404  (nice number to be in a web conference). On this three…",html:'<h1 id="web-summit-2016"><a href="#web-summit-2016" aria-hidden="true" class="anchor"><svg aria-hidden="true" height="16" version="1.1" viewBox="0 0 16 16" width="16"><path fill-rule="evenodd" d="M4 9h1v1H4c-1.5 0-3-1.69-3-3.5S2.55 3 4 3h4c1.45 0 3 1.69 3 3.5 0 1.41-.91 2.72-2 3.25V8.59c.58-.45 1-1.27 1-2.09C10 5.22 8.98 4 8 4H4c-.98 0-2 1.22-2 2.5S3 9 4 9zm9-3h-1v1h1c1 0 2 1.22 2 2.5S13.98 12 13 12H9c-.98 0-2-1.22-2-2.5 0-.83.42-1.64 1-2.09V6.25c-1.09.53-2 1.84-2 3.25C6 11.31 7.55 13 9 13h4c1.45 0 3-1.69 3-3.5S14.5 6 13 6z"></path></svg></a>Web Summit 2016</h1>\n<p>This year (2016) web summit was in Portugal (Lisbon). Was my first time in a conference like that.</p>\n<p>I stay in a little Hotel called Hotel of Chile with 2 stars - in the <strong>room 404</strong> (nice number to be in a web conference).</p>\n<p>On this three days i was selling the product where i’m working: <strong>Saas4saaS</strong> .</p>\n<h2 id="the-pitch-of-saas4saas-was-something-like-that"><a href="#the-pitch-of-saas4saas-was-something-like-that" aria-hidden="true" class="anchor"><svg aria-hidden="true" height="16" version="1.1" viewBox="0 0 16 16" width="16"><path fill-rule="evenodd" d="M4 9h1v1H4c-1.5 0-3-1.69-3-3.5S2.55 3 4 3h4c1.45 0 3 1.69 3 3.5 0 1.41-.91 2.72-2 3.25V8.59c.58-.45 1-1.27 1-2.09C10 5.22 8.98 4 8 4H4c-.98 0-2 1.22-2 2.5S3 9 4 9zm9-3h-1v1h1c1 0 2 1.22 2 2.5S13.98 12 13 12H9c-.98 0-2-1.22-2-2.5 0-.83.42-1.64 1-2.09V6.25c-1.09.53-2 1.84-2 3.25C6 11.31 7.55 13 9 13h4c1.45 0 3-1.69 3-3.5S14.5 6 13 6z"></path></svg></a>The pitch of Saas4saaS was something like that:</h2>\n<blockquote>\n<p>Saas4saas is a set of services to create software as a services.</p>\n</blockquote>\n<blockquote>\n<p>You know what is software as a service, right?</p>\n</blockquote>\n<blockquote>\n<p>So, imagine this:</p>\n</blockquote>\n<blockquote>\n<p>You in one month build the MVP of your product.\nOn this month you will concentrate on the core business of your product.</p>\n</blockquote>\n<blockquote>\n<p>After in one day integrating with Saas4saaS, you will have all the secondary\nstuff but important stuff.</p>\n</blockquote>\n<blockquote>\n<p>Things like Subscriptions, Resources limitations over the plans, User integrations with facebook, google\nAre Made but us.</p>\n</blockquote>\n<blockquote>\n<p><strong>So In one month building your MVP plus one day integrating with Saas4saaS\nYou have a professional product ready to market, ready to sell.</strong></p>\n</blockquote>\n<h2 id="pitch-results"><a href="#pitch-results" aria-hidden="true" class="anchor"><svg aria-hidden="true" height="16" version="1.1" viewBox="0 0 16 16" width="16"><path fill-rule="evenodd" d="M4 9h1v1H4c-1.5 0-3-1.69-3-3.5S2.55 3 4 3h4c1.45 0 3 1.69 3 3.5 0 1.41-.91 2.72-2 3.25V8.59c.58-.45 1-1.27 1-2.09C10 5.22 8.98 4 8 4H4c-.98 0-2 1.22-2 2.5S3 9 4 9zm9-3h-1v1h1c1 0 2 1.22 2 2.5S13.98 12 13 12H9c-.98 0-2-1.22-2-2.5 0-.83.42-1.64 1-2.09V6.25c-1.09.53-2 1.84-2 3.25C6 11.31 7.55 13 9 13h4c1.45 0 3-1.69 3-3.5S14.5 6 13 6z"></path></svg></a>Pitch Results</h2>\n<p>I think people like the idea and want this Saas4saaS. I will continue with more pilots tests and continue working.</p>\n<h2 id="nice-things-that-i-have-seen-on-web-summit"><a href="#nice-things-that-i-have-seen-on-web-summit" aria-hidden="true" class="anchor"><svg aria-hidden="true" height="16" version="1.1" viewBox="0 0 16 16" width="16"><path fill-rule="evenodd" d="M4 9h1v1H4c-1.5 0-3-1.69-3-3.5S2.55 3 4 3h4c1.45 0 3 1.69 3 3.5 0 1.41-.91 2.72-2 3.25V8.59c.58-.45 1-1.27 1-2.09C10 5.22 8.98 4 8 4H4c-.98 0-2 1.22-2 2.5S3 9 4 9zm9-3h-1v1h1c1 0 2 1.22 2 2.5S13.98 12 13 12H9c-.98 0-2-1.22-2-2.5 0-.83.42-1.64 1-2.09V6.25c-1.09.53-2 1.84-2 3.25C6 11.31 7.55 13 9 13h4c1.45 0 3-1.69 3-3.5S14.5 6 13 6z"></path></svg></a>Nice things that i have seen on web summit.</h2>\n<ul>\n<li>A email client for desktop - people still work on this? ok..</li>\n<li>A app to automatically choose what to wear, where i already see this?</li>\n<li>A app which convert legancy software to browser (they convert the interface into html, and keep running the program on its beckend servers). They show me paint on the browser, it is usefull for example for medical software</li>\n<li>The best startup ever: They make t-shirt with a swappable pocket in the front. “With the same t-shrt you can have a facebook pocket, a uber pocket, Twitter pocket - there are no limitations”   </li>\n<li>“Ican” a nice app to manage our personal goals, even if the goal is to be President of United States.</li>\n</ul>\n<h2 id="conclusion"><a href="#conclusion" aria-hidden="true" class="anchor"><svg aria-hidden="true" height="16" version="1.1" viewBox="0 0 16 16" width="16"><path fill-rule="evenodd" d="M4 9h1v1H4c-1.5 0-3-1.69-3-3.5S2.55 3 4 3h4c1.45 0 3 1.69 3 3.5 0 1.41-.91 2.72-2 3.25V8.59c.58-.45 1-1.27 1-2.09C10 5.22 8.98 4 8 4H4c-.98 0-2 1.22-2 2.5S3 9 4 9zm9-3h-1v1h1c1 0 2 1.22 2 2.5S13.98 12 13 12H9c-.98 0-2-1.22-2-2.5 0-.83.42-1.64 1-2.09V6.25c-1.09.53-2 1.84-2 3.25C6 11.31 7.55 13 9 13h4c1.45 0 3-1.69 3-3.5S14.5 6 13 6z"></path></svg></a>Conclusion</h2>\n<p>  <strong>I think when we are in a place like web-summit we are not in Lisbon on in Dublin.\nWe are in the world</strong></p>',id:"C:/Users/ruioliveiras/Desktop/ruioliveiras.com/content/blog/2016-11-15-web-summit/index.md absPath of file >>> MarkdownRemark",timeToRead:2,frontmatter:{date:"December 15, 2016",draft:!1,path:"/web-summit-2016",tags:[],title:"Web Summit 2016"}},next:!1}}}});
